import React from "react";
import PropTypes from "prop-types";

const Button = ({ text, color, onAdd }) => {
  return (
    <button
      className="btn"
      style={{ backgroundColor: color }}
      onClick={() => onAdd()}
    >
      {text}
    </button>
  );
};

Button.propTypes = {
  text: PropTypes.string,
};

export default Button;
